import React from 'react';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import './App.css';
import Login from './pages/login/Login';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/">
          </Route>
          <Route to="login">
            <Login></Login>
          </Route>
        </Switch>
      </div>
    </Router>

  );
}

export default App;
